import React, { useState } from "react";

const App = () => {

    const [good, setGood] = useState(0);

    const handleGood = () => {
        setGood(good + 1);
    }

    return <div>
        <h1>Give Feedback</h1>
        <button onClick={handleGood}>good</button>
        <button>neutral</button>
        <button>bad</button>
        <h1>Statistics</h1>
        <p>good {good}</p>
        <p>neutral</p>
        <p>bad</p>
    </div>
}

export default App;
